import React from "react";

const sampleInternships = [
  {
    id: 1,
    title: "Data Analyst Intern",
    organization: "Tech Solutions",
    location: "Delhi",
    reason: "Matches your Python and Data Analysis skills",
  },
  {
    id: 2,
    title: "Environmental Research Intern",
    organization: "Green Earth NGO",
    location: "Mumbai",
    reason: "Aligned with your sector interest: Environmental",
  },
  {
    id: 3,
    title: "Healthcare Data Intern",
    organization: "HealthPlus Labs",
    location: "Bangalore",
    reason: "Requires skills similar to yours: Excel, Python",
  },
];

function Recommendations({ userEmail }) {
  return (
    <div style={{ maxWidth: 600, margin: "30px auto", fontFamily: "Arial", padding: 20 }}>
      <h2>Recommended Internships for {userEmail}</h2>
      {sampleInternships.map(({ id, title, organization, location, reason }) => (
        <div
          key={id}
          style={{
            border: "1px solid #ccc",
            borderRadius: 8,
            padding: 15,
            marginBottom: 15,
            boxShadow: "0 2px 8px #eee",
          }}
        >
          <h3>{title}</h3>
          <p><strong>Organization:</strong> {organization}</p>
          <p><strong>Location:</strong> {location}</p>
          <p><em>Why Recommended:</em> {reason}</p>
          <button style={{ marginRight: 10, padding: "8px 12px" }} onClick={() => alert("Applied successfully!")}>Apply</button>
          <button style={{ padding: "8px 12px" }} onClick={() => alert("Saved for later!")}>Save</button>
        </div>
      ))}
    </div>
  );
}

export default Recommendations;
